  [],\n\t\"revision_timestamp\": \"2016-10-03T22:03:30.540524\",\n\t\"name\": \"nodc-standard-product-coastal-change-analysis-program-c-cap-chesapeake-bay-region-data-on-cd-ro\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The data set on this CD-ROM shows changes
  in land cover for the Chesapeake Bay region over the 5-year interval from 1984 to
  1988-89. The data set was produced through a multi-year effort that focused on the
  Chesapeake Bay as a prototype for the Coastal Change Analysis Program (C-CAP) of
  the NOAA Coastal Ocean Program's Estuarine Habitat Studies Program. The CD-ROM was
  produced cooperatively by the National Marine Fisheries Service, the National Geophysical
  Data Center, and the National Oceanographic Data Center.nnThe Chesapeake Bay Land
  Classification Data Set is based on an analysis of Landsat Thematic Mapper (TM)
  scenes of the Chesapeake Bay region. This CD-ROM contains three data sets: 1. Analysis
  of four Landsat Thematic Mapper scenes from 1984. 2. Analysis of four Landsat Thematic
  Mapper scenes from 1988-89 for the same area, and 3. Analysis of the resulting change
  between 1984 and 1988-89. The land cover analyses distinguish 14 land cover classes.
  The change analysis resulted in 81 classes.nnThe data are in a binary unblocked
  format. A record equals one row of pixels, and the first data value is in the upper
  left-hand corner of the image. The CD-ROM includes GeoVu display software developed
  by the National Geophysical Data Center.nnThis NODC standard CD-ROM product is also
  available online at http://ols.nndc.noaa.gov/plolstore/plsql/olstore.prodspecific?prodnum=W00014-CDR-S0001.\",\n\t\"license_title\":
